import React, { Component } from 'react';
//import logo from './logo.svg';
import './App.css';

class App extends Component {
  render(){

    return(
      <div class="col">
        <div class="row1">
          <Strbox/>
        </div>
        <div class="row2">
          <DFA/>
        </div>
      </div>
    );
  }
}
class Strbox extends Component{
  render(){
    return(
      <div>
        <h2>Put string here</h2>
        <input type="text" onChange="">

        </input>
      </div>
    );
  }
}

class DFA extends Component{
  render(){
    return(
      <div>
        <h1>DFA</h1>
      </div>
    );
  }
}


export default App;
